Charles knows his boss Sophia sleeps around with some of the guys at the office. He asks her to give him a raise and his own office or he will tell her supervisors about the situation. Sophia refuses to be blackmailed an is completely unfazed by Charles's ploy. Charles now finds himself in the position to beg Sophia not to fire him for his insolence, but Sophia's going to make him fuck for forgiveness.
